import React from "react";
import ReactDOM from "react-dom";
import ApolloClient from "apollo-boost";
import { ApolloProvider } from "react-apollo-hooks";
import { useQuery } from "react-apollo-hooks";
import gql from "graphql-tag";
import USAMap from "react-usa-map";

// import App from "./App.js";

const client = new ApolloClient({ uri: "http://localhost:4000" });

const GET_STATE_DATA = gql`
  query GetStateData {
    usaMapData(stateCode: "AZ") {
      id
      name
    }
  }
`;
mapHandler = (event) => {
  alert(event.target.innerHTML);
};

function CApp() {
  const { loading, error, data } = useQuery(GET_STATE_DATA);

  if (loading) return <p>Loading...</p>;

  if (error) return <p>Error: {error.message}</p>;

  return (
    <div>
      <h1>Users</h1>
      <ul>
        {/* {data.usaMapData.map((user) => ( */}
        <li key={data.id}>
          <p>Name: {data.usaMapData.name}</p>
        </li>
        {/* ))} */}
      </ul>
      <USAMap onClick={this.mapHandler} defaultFill="rgb(247, 166, 15)" />
    </div>
  );
}

ReactDOM.render(
  <ApolloProvider client={client}>
    <CApp />
  </ApolloProvider>,

  document.getElementById("root")
);
